import React from 'react';
import ReactDOM from 'react-dom';
import SocialMedia from './SocialMedia.js'
import './Footer.css'

class Footer extends React.Component {
  render() {
    return (
      <div className="container-fluid mb-5 ">
        <SocialMedia />
        <div class="foot">

        </div>

      </div>
    );
  }
}

export default Footer;
